export const LogIn = ()=>{
    return(
        <Grid>
            <GridCol span={{ base: 12, md: 6 }}><AuthenticationTitle/></GridCol>
            <GridCol span={{ base: 12, md: 6 }}><CarouselCard/></GridCol>
        </Grid>
    );
};
